import './ExpenseItem.css'

function ExpenseItem(props) {
    const year = props.date.toLocaleString('us-eng', {year:'4-digit'});
    const month = props.date.toLocaleString('us-eng', {year:'long'});
    const day = props.date.toLocaleString('us-eng', {year:'2-digit'});
    return (
        <div className="expense-item">
            <div>
                <div className="expense-item__year">{year}</div>
                <div className="expense-item__month">month</div>
                <div className="expense-item__day">day</div>
            </div>
            <div className="expense-item__description">
                <h2>{props.title}</h2>
                <div className="expense-item__price"> $ {props.amount}</div>
            </div>
        </div>);
}

export default ExpenseItem;
